import React, { Component } from 'react';
class Recipe extends Component {
  render() {
    console.log(this.props.recipe);
    const {image_url,title,source_url,publisher,recipe_id} = this.props;
    return (
        <React.Fragment>
          Hello from Recipe
        </React.Fragment>
      );
  }
}
export default Recipe;
